import React, { Component } from "react";
import Navigation from "../components/Navigation";

class Portfolio extends Component {
  state = {
    myPorftolio: [
      {
        id: 13,
        mytitle: "Wacom",
        myContent:
          " Some quick example text to build on the card title and make up the bulk of the card's content.",
        myImg: "../../../images/cinq_1.webp"
      },
      {
        id: 14,
        mytitle: "Calculatrice",
        myContent:
          " Some quick example text to build on the card title and make up the bulk of the card's content.",
        myImg: "../../../images/trois_1.webp"
      },
      {
        id: 14,
        mytitle: "La chouette agence",
        myContent:
          " Some quick example text to build on the card title and make up the bulk of the card's content.",
        myImg: "../../../images/deux_1.webp"
      },
      {
        id: 15,
        mytitle: "Polind",
        myContent:
          " Some quick example text to build on the card title and make up the bulk of the card's content.",
        myImg: "../../../images/quatrez_1.webp"
      },
      {
        id: 16,
        mytitle: "générateur de citation",
        myContent:
          " Some quick example text to build on the card title and make up the bulk of the card's content.",
        myImg: "../../../images/un.webp"
      }
    ]
  };
  render() {
    let myPorftolio = this.state;
    return (
      <>
        <Navigation />
        <div className="col-xl">
          <h1 className="profile display-4 fw-bolder">Portfolio</h1>

          {myPorftolio.map(portfolio => {
            <div
              className="card"
              style={{
                width: "23rem",
                height: "330px"
              }}
            >
              <img src={portfolio.myImg} className="card-img-top" alt="..." />
              <div className="card-body ">
                <h3 className="card-title">{portfolio.mytitle}</h3>
                <p className="card-text">{portfolio.myContent}</p>
              </div>
            </div>;
          })}
        </div>
      </>
    );
  }
}

export default Portfolio;
